_vue.default.prototype.doUrl = function (url, param, islogin, msg) {
  url = url.replace(" ", "");
  if (url == '#' || url == '' || url == 'http://' || url == 'https://') {
    return;
  }
  var urlparam = utils.urlToarray(url.replace("??", "?"));
  var params = utils.parseParam(param).toLowerCase() + '&' + utils.parseParam(urlparam).toLowerCase();
  if (islogin != undefined && islogin != false && utils.isLogin() == false) {
    utils.login(msg);
    return;
  }
  //直接URL跳转
  if (url.substr(0, 4) == 'http') {
    uni.navigateTo({
      url: "/pages/webview/webview?" + params + "&url=" + url });

    return;
  }
  //根据Controller + Action跳转
  var urls = url.indexOf("?") < 0 ? url : url.substr(0, url.indexOf('?'));
  var uri = urls.indexOf("pages/") < 0 ? "/pages/" + urls : '/' + urls;
  uri = uri.replace("//", "/") + '?' + params;
  uni.navigateTo({
    url: uri,
    fail: function fail() {
      uni.showToast({
        title: "该功能正在开发中，请耐心等待更新！！",
        icon: "none",
        duration: 3000 });

    } });

};

